CONSTRUCT { ?artist1 a :BandMemberOf ?band; owl:hasRole ?role1. ?role1 rdfs:label "Nevermore"@en. }
UNION
{
  CONSTRUCT { ?artist2 a :BandMemberOf ?band; owl:hasRole ?role2. ?role2 rdfs:label "Jim Sheppard"@en. }
  WHERE { ?artist2 <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/BandMember>. <http://dbpedia.org/resource/Jim_Sheppard> rdfs:label "Jim Sheppard"@en. }
}
AS ?union

SELECT ?result1 ?role1 WHERE { ?result1 a :BandMemberOf ?band; owl:hasRole ?role1. ?role1 rdfs:label "Nevermore"@en. }

UNION
{
  SELECT ?result2 ?role2 WHERE { ?result2 a :BandMemberOf ?band; owl:hasRole ?role2. ?role2 rdfs:label "Jim Sheppard"@en. }
  WHERE {
    ?result2 <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/BandMember>.
    <http://dbpedia.org/resource/Jim_Sheppard> rdfs:label "Jim Sheppard"@en.
  }
}

AS ?union2

WHERE {
  ?union1 ?role1 = ?role2 .
  ?union2 ?role2 = ?role1
}

